  font-weight: normal;
}

.source-link-hidden {
  display: none;
} /**/

/* Search and history */
#search-input {
  margin-bottom: 1rem;
}

#search-input + :is(.problem-section, .notes) {
  margin-top: 2rem;
}

.results-notice {
  color: var(--minor-color);
  font-style: italic;
}

.result-item {
  margin: 1em 0;
}

.result-title {
  margin: 0 0 0.2em;
  font: 600 1.15rem "Computer Modern Bright", sans-serif;
}

.result-snippet {
  margin: 0;
  font: normal 0.88rem / 1.4 "Fira Mono", monospace;
  overflow-wrap: break-word;
} /**/

/* Headings */
.article-text :is(h1, h2),
h3 {
  font: bold 1.16rem "Computer Modern Bright", sans-serif;
  letter-spacing: 0.05em;
  text-transform: uppercase;
  border-bottom: 1px solid var(--hr-color);
}

.article-text:not(.batch-solutions-text) :is(h1, h2),
.problem-heading {
  margin-top: 1.5em;
}

#full-text h3 {
  letter-spacing: initial;
  text-transform: initial;
  border: none;
}

.batch-solutions-text :is(h2:not(.problem-heading), h3) {
  font-size: 1.05em;
  font-family: inherit;
  letter-spacing: initial;
  text-transform: initial;
  border: none;
}

.solutions-divider {
  font: 600 italic 1.25rem "Computer Modern Bright", sans-serif;
  letter-spacing: 0.02em;
  border-bottom: 1px dashed var(--hr-color);
}

.article-problem {
  break-inside: avoid;
} /**/

/* Misc */
u {
  text-decoration-thickness: 1px;
  text-underline-offset: 1px;
}

code,
pre {
  font: 0.9rem "Fira Mono", monospace;
}

hr {
  border-color: var(--hr-color);
  border-style: solid;
  border-top: none;
}

.article-text :is(dl:first-child,
.problem-heading + dl, /* redirect disclaimers etc */
.mw-editsection,
p:empty,
p > br:only-child) {
  display: none;
}

img,
.thumbinner {
  max-width: 100% !important; /* override inline widths */
  height: auto;
}

img.latex {
  display: inline-block;
}

img.latexcenter {
  display: block;
  margin: auto;
  padding: 10px;
  text-align: center;
}

.thumbcaption {
  font-size: 0.95em;
  font-style: italic;
}

div.tright,
div.floatright,
table.floatright {
  float: right;
  clear: right;
}

table:first-child {
  margin: auto;
  margin-top: 1em;
}

.wikitable {
  border-collapse: collapse;
  border-spacing: 0;
}

.wikitable tr:first-child > * {
  border-bottom: 1px solid var(--hr-color);
}

.wikitable :is(th, td) {
  padding: 0.1em 0.5em;
}

.error {
  color: var(--error-color);
}

.frontlink {
  font-family: "Computer Modern Bright", sans-serif; /* Main page */
}

.stats-notes {
  margin-top: 1em;
  border-top: 1px solid var(--hr-color);
}

.list-indent {
  margin-top: -1em;
  list-style: "⁃ ";
  padding-inline-start: min(6vw, 2em);
}

.list-inner {
  list-style: "⁃ ";
  padding-inline-start: min(6vw, 2em);
}

.list-head {
  font-weight: bold;
}

.list-minor {
  font-size: 0.95em;
}

/* .list-answered::marker {
  color: var(--minor-color);
  font-family: "Inter", sans-serif;
  content: "?  ";
}

.list-correct::marker {
  color: var(--correct-color);
  font-family: "Inter", sans-serif;
  content: "✓  ";
}

.list-retry::marker {
  color: var(--retry-color);
  font-family: "Inter", sans-serif;
  content: "↻  ";
}

.list-wrong::marker {
  color: var(--wrong-color);
  font-family: "Inter", sans-serif;
  content: "✗  ";
} */

#stats-chart {
  float: right;
}

.brag {
  font-style: italic;
} /**/

/* KaTeX */
.fallback-container:not(.fallback-live),
.katex-broken {
  display: none;
}

.katex {
  font-size: 1em;
}

.katex .base {
  display: inline;
  white-space: break-spaces;
}

.katex-display {
  padding-top: 2px;
  overflow: auto hidden;
}

.katex-display .katex .base {
  display: inline-block;
  white-space: nowrap;
} /**/

/* Element states */
:is(a, .text-button, mjx-container):focus {
  outline: 1.5px solid var(--placeholder-color);
  outline-offset: 2px;
}

::selection {
  background: hsl(201 80% 70% / 35%);
} /**/

/* Main and footer */
main {
  flex: auto;
  min-height: auto;
}

footer {
  padding-bottom: 1em;
  color: var(--secondary-color);
  font: 600 1em "Computer Modern Bright", sans-serif;
  line-height: 1.5;
  text-align: right;
  border-top: 1px solid var(--hr-color);
}

.footer-line {
  margin: 0.4em 0;
}

.disclaimer {
  font-style: italic;
}

.mobile-break {
  display: none;
} /**/

/* Loading bar */
.loading-notice {
  display: flex;
  margin: 1rem 0 var(--vertical-item-spacing);
}

.loading-bar-container {
  flex: 1;
  box-sizing: border-box;
  height: 1.2em;
  margin-left: 0.6rem;
  padding: 2px;
  border: 2px solid var(--input-slider-color);
  border-radius: 0.3rem;
}

.loading-bar {
  width: 0%;
  height: 100%;
  background: var(--input-accent-color);
  border-radius: 0.2rem;
  transition: width 0.1s linear;
} /**/

/* Breakpoint layouts */
@media (max-width: 1500px) {
  .page-container {
    width: 1200px;
  }
}

@media (max-width: 1350px) {
  .page-container {
    width: 1125px;
  }

  .input-flexone-full,
  .input-button-flexone-full {
    flex: 100%;
  }

  .input-flexone-half {
    flex: 48%;
  }
}

@media (max-width: 1200px) {
  .page-container {
    width: 1000px;
  }

  .button-text {
    display: none;
  }

  .button-icon {
    display: block;
  }
}

@media (max-width: 1050px) {
  .page-container {
    width: 90%;
  }

  .settings-text {
    display: block;
    margin: 0 0 0.25em 0;
    padding: 0.1em 0 0.15em;
    border-right: none;
    border-bottom: 1px solid var(--divider-color);
  }
}

@media (max-width: 1000px) {
  .shortcut-button {
    flex: 48%;
  }

  .button-container {
    flex-wrap: wrap;
  }

  .wide-button {
    flex: 48%;
  }

  .checkbox-container,
  .input-button-flex-full {
    flex: 100%;
  }
}

@media (max-width: 800px) {
  .page-container {
    width: 100%;
    padding: 0 1rem;
  }

  .tagify.input-multi {
    flex-wrap: wrap;
    max-height: initial;
  }

  .input-flex-full,
  .input-button {
    flex: 100%;
  }

  .input-flex-half {
    flex: 48%;
  }
}

@media (max-width: 600px) {
  .article-text {
    overflow-wrap: break-word;
  }

  .wide-button,
  .shortcut-button {
    flex: 100%;
  }

  .secondary-button {
    flex: 1;
  }

  .secondary-spacer {
    display: none;
  }

  .list-head {
    clear: both;
  }

  #stats-chart {
    display: flex;
    justify-content: center;
    width: 100%;
    margin: 0.5rem 0;
  }

  #stats-chart svg > g {
    width: 100% !important;
  }

  #notes-text,
  #notes-text ul {
    padding-inline-start: 1.5rem;
  }
}

@media (max-width: 500px) {
  .source-link {
    display: inline-block;
  }

  .practice-progress:not(.progress-nobottom) {
    height: calc(4rem + var(--vertical-item-spacing));
  }

  .spacer-bar {
    display: block;
    flex-basis: 100%;
    height: 0;
  }

  .bullet {
    display: none;
  }

  .mobile-break {
    display: inline;
  }
}

@media (max-width: 450px) {
  .page-container {
    box-shadow: none;
  }

  .problem-section {
    padding: 0.5rem 0.8rem;
    box-shadow: var(--minor-box-shadow);
  }

  .display-settings {
    box-shadow: var(--minor-box-shadow);
  }

  .section-header {
    margin-right: -0.8rem;
    margin-left: -0.8rem;
  }
}

@media (max-width: 436px) {
  .input-flexino-full {
    flex: 100%;
  }
} /**/

/* Animations */
@keyframes show {
  from {
    opacity: 0;
  }
  to {
    opacity: 1;
  }
}

@keyframes shake {
  0% {
    transform: translate(-1px, 0);
  }

  10% {
    transform: translate(1px, 0);
  }

  20% {
    transform: translate(0, 0);
  }

  30% {
    transform: translate(-1px, 0);
  }

  40% {
    transform: translate(1px, 0);
  }

  50% {
    transform: translate(0, 0);
  }

  60% {
    transform: translate(-1px, 0);
  }

  70% {
    transform: translate(1px, 0);
  }

  80% {
    transform: translate(0, 0);
  }

  90% {
    transform: translate(-1px, 0);
  }

  100% {
    transform: translate(1px, 0);
  }
}

@keyframes glow {
  0% {
    box-shadow: var(--secondary-box-shadow), 0 0 0 transparent;
  }

  10% {
    box-shadow: var(--secondary-box-shadow), 0 0 5px hsl(0 80% 70%);
  }

  20% {
    box-shadow: var(--secondary-box-shadow), 0 0 5px hsl(40 80% 70%);
  }

  30% {
    box-shadow: var(--secondary-box-shadow), 0 0 5px hsl(80 80% 70%);
  }

  40% {
    box-shadow: var(--secondary-box-shadow), 0 0 5px hsl(120 80% 70%);
  }

  50% {
    box-shadow: var(--secondary-box-shadow), 0 0 5px hsl(160 80% 70%);
  }

  60% {
    box-shadow: var(--secondary-box-shadow), 0 0 5px hsl(200 80% 70%);
  }

  70% {
    box-shadow: var(--secondary-box-shadow), 0 0 5px hsl(240 80% 70%);
  }

  80% {
    box-shadow: var(--secondary-box-shadow), 0 0 5px hsl(280 80% 70%);
  }

  90% {
    box-shadow: var(--secondary-box-shadow), 0 0 5px hsl(320 80% 70%);
  }

  100% {
    box-shadow: var(--secondary-box-shadow), 0 0 0 transparent;
  }
}

.shake {
  animation: shake 0.5s;
}

.glow {
  animation: glow 2s;
} /**/

/* Print styling */
@media print {
  /* Font fixes */
  body,
  .article-text {
    color: black;
    font-size: 11pt;
  }

  .article-text h3 {
    font-size: 11.5pt;
  }

  .article-text :is(h1, h2) {
    font-size: 12pt;
  }

  img.latex {
    transform: scale(0.9);
  } /**/

  /* Prettier */
  .section-header {
    margin: 0 0 1rem;
    padding: 0;
    color: inherit;
    font: 2rem "Latin Modern Sans Demi-Condensed", sans-serif;
    text-shadow: none;
    background: none;
  }

  .page-container,
  .problem-section {
    box-shadow: none;
  }

  footer {
    margin: 0 2rem;
    font: normal 1em "Latin Modern Sans", sans-serif;
  }

  footer a {
    color: inherit;
    text-decoration-line: underline;
    text-decoration-color: var(--link-color);
    text-decoration-thickness: 1px;
    text-underline-offset: 3px;
  } /**/

  /* Hide things */
  .dialog-nav,
  .header,
  .subtitle,
  .intro-header,
  .shortcut-container,
  .button-container,
  .options-input,
  .options-container,
  #difficulty-info,
  .random-input-active + .practice-progress,
  .answer-check,
  .notes,
  .error,
  a.aops-link,
  .section-options,
  .article-problem:hover .replace-problem,
  #batchans-section,
  .section-collapsed,
  #solutions-header::after,
  .display-settings,
  .noprint {
    display: none;
  }

  .page-container:not(.links-text) :is(a, a[title], a.external) {
    color: inherit;
    text-decoration-line: none;
  } /**/

  /* Footer */
  .page-container {
    min-height: initial;
  }

  .footer-fixed {
    position: fixed;
    bottom: 0;
  } /**/
}

@media screen {
  .printonly {
    display: none;
  }
} /**/

